import React from 'react';

class City extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            src: props.src
        };
    }

    render() {
        return (
            <div className="city">
                <img src={this.props.src} alt="City profile"></img>
            </div>
        );
    }
}

export default City;
